– intensificare la cooperazione commerciale instaurando una cooperazione normativa duratura nei settori pertinenti, nel rispetto dei diritti e degli obblighi derivanti dall'adesione all'Organizzazione mondiale del commercio;

– creare le condizioni per una cooperazione sempre più stretta in altri settori di reciproco interesse.
